        MXWindow *window = new MXWindow(this, "Hello, MINGl!");
        window->setSize(300, 200);
        window->setPosition(100, 100);
        window->show();
    }
};

int main(int argc, char *argv[]) {
    MyApp app;
    app.run(argc, argv);
    return 0;
}
```

Save this code in a file called `main.cpp`.

